const Movie = ({ movie }) => {

    return (
        <li className="movie" key={movie.id}>
            <img src={movie.poster} alt={movie.title} />
            <p>
                {movie.title} by {movie.director}
                wass relased on {movie.year}
            </p>
            <p>Rating: {movie.rating}</p>
        </li>
    )
};

export default Movie;
